local function formatSmart(sec)
    local years = math.floor(sec / 31536000)
    sec %= 31536000
    local days = math.floor(sec / 86400)
    sec %= 86400
    local hours = math.floor(sec / 3600)
    sec %= 3600
    local minutes = math.floor(sec / 60)
    local seconds = sec % 60

    local t = {}
    if years > 0 then table.insert(t, years) end
    if days > 0 or years > 0 then table.insert(t, days) end
    if hours > 0 or days > 0 or years > 0 then table.insert(t, string.format("%02d", hours)) end
    if minutes > 0 or hours > 0 or days > 0 or years > 0 then table.insert(t, string.format("%02d", minutes)) end
    table.insert(t, string.format("%02d", seconds))

    return table.concat(t, ":")
end

